import { useState } from "react"

const Floor = () => {
    const [floor, setFloor] = useState()

    function Male(cb, cat){
        cb = document.getElementById('cd')
        cat = document.getElementById('cat')
        if (cb.chacked) {
            setFloor('Male')
        } else if (cat.chacked) {
            setFloor('Female')
        } else {
            setFloor('Penis')
        }
    }

    return(
        <>
            <div>
                <input id="cd"type="checkbox" name="male" onInput={Male} />
                <label for="male">Male</label>
            </div>
            <div>
                <input id="cat"type="checkbox" name="female" onInput={Male}/>
                <label for="female">Female</label>   
            </div>
            <p>{floor}</p>
        </>
    )
}

export default Floor;
